import React from 'react';
import ReactDOM from 'react-dom';
import Home from './Home';
import Default from './Default';
import Gettest from './Gettest';
import Login from './Login';
import Registration from './Registration';
import testHome from './testHome';
import 'bootstrap/dist/css/bootstrap.min.css';
import { BrowserRouter, Route, Switch } from "react-router-dom";




ReactDOM.render(
	<BrowserRouter>
    <Switch>
      <Route path='/default/:data' caseSensitive={false} component={<Default />} />
      <Route path='/gettest/:data' caseSensitive={false} component={<Gettest />} />
      <Route path='/register' caseSensitive={false} component={<testHome />} />
      <Route path='/' caseSensitive={false} component={<Home />} />
      <Route path='/Home/:data' caseSensitive={false} component={<Home />} />
      <Route path='/login' caseSensitive={false} component={<Login />} />
      <Route path='/registration' caseSensitive={false} component={<Registration />} />
      <Route path='/test' caseSensitive={false} component={<test />} />
    </Switch>
  </BrowserRouter>,

	document.getElementById('root'));
